// Write your code here.
import {Component} from 'react'
import './index.css'

class CoffeePlanner extends Component {
  constructor(props) {
    super(props)
    const {coffeePlanarList} = props
    let selected = {}
    for (let question of coffeePlanarList) selected[question.id] = null
    this.state = selected
  }
}

export default CoffeePlanner
